    def validate_button_click(self):
        columns1=list()
        columns2=list()
        columns3=list()
        self.problem_text.setText('')
        
        # Spesifik koşulların kontrolü gerçekleştiriliyor
        
        if(self.smilar_noting.isChecked()):
            columns1.append("nothing")
        else:
            if(self.smilar_prod.isChecked()):
                columns1.append(self.smilar_prod.text())
            if(self.smilar_company.isChecked()):
                columns1.append(self.smilar_company.text())
            if(self.smilar_issue.isChecked()):
                columns1.append(self.smilar_issue.text())
            if(self.smilar_state.isChecked()):
                columns1.append(self.smilar_state.text())
            if(self.smilar_zipcode.isChecked()):
                columns1.append(self.smilar_zipcode.text())  
            if(self.spec_complaintid.isChecked()):
                columns1.append(self.spec_complaintid.text())
            
        # Karşılaştırma koşulların kontrolü gerçekleştiriliyor
        
        if(self.compare_company.checkState()):
            columns2.append(self.compare_company.text())
        if(self.compare_issue.checkState()):
            columns2.append(self.compare_issue.text())
        if(self.compare_prod.checkState()):
            columns2.append(self.compare_prod.text())
        if(self.compare_state.checkState()):
            columns2.append(self.compare_state.text())
        if(self.compare_zipcode.checkState()):
            columns2.append(self.compare_zipcode.text())
            
        # Gösterilecek sütunların koşulları kontrol ediliyor
    
        if(self.view_state.checkState()):
            columns3.append(self.view_state.text())
        if(self.view_complaintid.checkState()):
            columns3.append(self.view_complaintid.text())
        if(self.view_issue.checkState()):
            columns3.append(self.view_issue.text())
        if(self.view_zipcode.checkState()):
            columns3.append(self.view_zipcode.text())
        if(self.view_prod.checkState()):
            columns3.append(self.view_prod.text())
        if(self.view_company.checkState()):
            columns3.append(self.view_company.text())
        
        thread_count_s=self.thread_count.text()
        smilarity_rating=self.similarity_rating.text()
        
        if(len(columns1)<0 or len(columns2)<0 or len(columns3)<0):
            
            self.problem_text.setText('Lütfen eksik bilgileri doldurunuz.')
        else:
            
            if(self.spec_complaintid.isChecked()):
                rate=self.spesific_complaint_id.text()
                if(rate==''):
                    self.problem_text.setText('Lütfen spesifik complaint id giriniz.')
                else:
                    columns1.append(rate)
                    thread_count_s=self.thread_count.text()
                    smilarity_rating=self.similarity_rating.text()
                    
                    if(thread_count_s.isnumeric() and smilarity_rating.isnumeric()):
                        
                        print(columns1)
                        print(columns2)
                        print(columns3)
                    else:
                        self.problem_text.setText('Thread sayısı veya benzerlik oranı sayısal değer olmalıdır.')
            else:        
            
            
                thread_count_s=self.thread_count.text()
                smilarity_rating=self.similarity_rating.text()
                
                if(thread_count_s.isnumeric() and smilarity_rating.isnumeric()):
                    
                    comparing.setThreadIndex(threadCount=thread_count_s,list1=columns1,list2=columns2,list3=columns3,rate=smilarity_rating)
                    
                else:
                    self.problem_text.setText('Thread sayısı veya benzerlik oranı sayısal değer olmalıdır.')
        


